import React from "react";
import { BrowserRouter ,Route,Routes,Link} from "react-router-dom";
import Detailview from "./Detailview";
import './Detail.css';
const Detail = () =>{
    return(
        <BrowserRouter>
              <Link to="/detail"><Detailview/></Link>
            <Routes>
                <Route path="/detail" element={<Detail />}/>
            </Routes>
        </BrowserRouter>
    )
}

export default Detail
